I Have a Wife - Savannah Stern 

Release Date: February 18, 2011

Tim answers the knock at his door to find a sexy woman named Savannah telling him she's arrived for the appointment, but he has no idea what she's talking about. Turns out Savannah's at the wrong house, so she makes a phone call but can't reach her client. As Tim's wife is calling to tell him she'll be home in an hour, Savannah secretly slips into something a little more comfortable (i.e., nothing). He finishes his call and turns around to find a pair of big titties in his face and an hour to kill. You do the math.
